#include <stdio.h>
#include <stdbool.h>
#include <string.h>

int isValid(int* freq, int k) {
    for (int i = 0; i < 26; i++) {
        if (freq[i] && freq[i] != k) return false;
    }
    return true;
}

int countCompleteSubstrings(char* word, int k) {
    int count = 0, n = strlen(word);
    for (int start = 0; start < n; start++) {
        int freq[26] = {0}, uniqueChars = 0;
        for (int end = start; end < n; end++) {
            if (++freq[word[end] - 'a'] == k) uniqueChars++;
            if (freq[word[end] - 'a'] > k) uniqueChars--;
            if (uniqueChars > 0 && isValid(freq, k)) {
                count++;
            }
        }
    }
    return count;
}
